import {React, useEffect, useState} from 'react';

const Cart = () => {
    const [productData, setProductData] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:5000/cart`)
        .then(response => response.json())
        .then(data => {
            setProductData(data);
        })
        .catch(error => {
            console.error(error);
        })
    }, []);

    if(productData) {return (
        <div>Cart</div>
    )
    }
}

export default Cart
